import React from 'react'
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs'

export default function index() {
    return (
        <Tabs className="mainTabs">
            <TabList>
                <Tab>Random</Tab>
                <Tab>Search</Tab>
            </TabList>

            <TabPanel></TabPanel>
        </Tabs>
    )
}
